        for (int i=0; i<nums.length/2;i++) {
            int temp = nums[i];
            nums[i] = nums[nums.length - 1 - i];
            nums[nums.length - 1 - i] = temp;
        }
        int elemCounted = 1;
        int prevElem=nums[0];
        for (int i = 1; i<nums.length;i++) {
            if (nums[i] != prevElem) {
                elemCounted += 1;
                prevElem = nums[i];
            }
            if (elemCounted == 3) {
                return nums[i];
            }
        }
        return nums[0];
    }
}

