class Solution {
public:
    int thirdMax(vector<int>& nums) {
        int n = nums.size();
        int max = nums[0];
        int min = nums[0];
        int sec = 0;
        for(int i=0;i<n;i++){
            if(nums[i] > max){
                max = nums[i];
            }
        }
        for(int i=0;i<n;i++){
            if(nums[i] < min){
                min = nums[i];
            }
        }
        for(int i=0;i<n;i++){
            if(nums[i] > min && nums[i] < max){
                sec = nums[i];
            }
        }
        if(sec > 0){
            return max;
        }
        return min;
    }
};

