class Solution {
    public int thirdMax(int[] n)
    {
       int l=n.length;
       int fmax=Integer.MIN_VALUE,smax=Integer.MIN_VALUE,tmax=Integer.MIN_VALUE;
       HashSet<Integer> uni=new HashSet<>();
       for(int i:n)
       {
          uni.add(i);
       }
       for(int i:uni)
       {
          if(fmax<i)
          {
            tmax=smax;
            smax=fmax;
            fmax=i;
          }
          else if(smax<i && smax!=fmax)
          {
             tmax=smax;
             smax=i;
          }
          else if(tmax<i && tmax!=smax && tmax!=fmax)
          {
             tmax=i;
          }
       }
       if(uni.size()<=2) return fmax;
       return tmax;
    }
}

class Solution {
    public int thirdMax(int[] nums) {
        Arrays.sort(nums);
        int count=0;
        for(int i=nums.length-1;i>0;i--){
            if(nums[i]!=nums[i-1]) count++;
            if(count==2) return nums[i-1];
        }
        return nums[nums.length-1];
    }
}

